/*Table structure for table `leader_account` */

DROP TABLE IF EXISTS `leader_account`;

CREATE TABLE `leader_account` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `leader_id` varchar(36) DEFAULT NULL COMMENT '团长ID',
  `total_amount` decimal(12,2) DEFAULT NULL COMMENT '总收益, 可能有部分余额因为订单未结束而不能提现',
